import React from "react";

const styles = {
    gen_box:{
        width: '300px',
        marginInline: 'auto',
        marginTop: '200px',
        backgroundColor: 'blue'
    },
    gen_but:{
        width: '100px',
        marginBottom: '20px',
        marginLeft: '100px',
        height: '30px',
        display: 'block',
        color: 'red'
    }
}

function App() {
  return (
      <div style={styles.gen_box}>
        <button style={styles.gen_but}>Add Template</button>
        <button style={styles.gen_but}>Use Template</button>
      </div>
  );
}

export default App;
